INSERT INTO `engine_etls` VALUES (1, 'daily', 1, '清洗(mobile)', 'test', '2019-08-30 16:32:20', '2019-08-30 16:32:23', 1, 0, 'parpare', 'INSERT OVERWRITE TABLE etl_dailyreport.cleaned_dau PARTITION (snid=$snid,gameid=$gameid,ds=\'$ds\')\nSELECT /*+ MAPJOIN(t_1) */ t_1.userid userid,\n       if(ip = \'\'\n          OR ip IS NULL,\'unknown\',ip) ip,\n       if(roleid=\'\'\n          OR roleid IS NULL,\'unknown\',roleid) roleid,\n       if(SOURCE = \'\'\n          OR SOURCE IS NULL,\"unknown\",SOURCE) SOURCE,\n                                              if(creative = \'\'\n                                                 OR creative IS NULL,\"unknown\",creative) creative,\n                                              if(udid = \'\'\n                                                 OR udid IS NULL,\"unknown\",udid) udid,\n                                              if(clientid = \'\'\n                                                 OR clientid IS NULL,\'unknown\',clientid) clientid\nFROM\n  (SELECT userid,\n          collect_set(ds)[0] ds, collect_set(ip)[0] ip\n   FROM dau\n   WHERE snid=$snid\n     AND gameid=$gameid\n     AND ds=\'$ds\'\n     GROUP BY userid) t_1\nJOIN\n  (SELECT * from(select userid,\n          snid,\n          gameid,\n          ds,\n          roleid,\n          SOURCE,\n          creative,\n          udid,\n          clientid,\n          row_number() OVER(PARTITION BY userid ORDER by installdate,installtime DESC) index\n   FROM install\n   WHERE snid=$snid\n     AND gameid=$gameid) t_3 \n     WHERE t_3.index=1) t_2 ON t_1.userid =t_2.userid;\n\nINSERT OVERWRITE TABLE etl_dailyreport.cleaned_payment PARTITION (snid=$snid,gameid=$gameid,ds=\'$ds\')\nSELECT /*+ MAPJOIN(t_1) */ t_1.userid userid,\n                           if(t_2.roleid=\'\'\n                              OR t_2.roleid IS NULL,\'unknown\',t_2.roleid) roleid,\n                           if(t_2.SOURCE = \'\'\n                              OR t_2.SOURCE IS NULL,\"unknown\",t_2.SOURCE) SOURCE,\n                                                                          if(t_2.creative = \'\'\n                                                                             OR t_2.creative IS NULL,\"unknown\",t_2.creative) creative,\n                                                                          if(t_2.udid = \'\'\n                                                                             OR t_2.udid IS NULL,\"unknown\",t_2.udid) udid,\n                                                                          if(t_2.clientid = \'\'\n                                                                             OR t_2.clientid IS NULL,\'unknown\',t_2.clientid) clientid,\n                                                                          if(t_1.currency= \'\'\n                                                                             OR t_1.currency IS NULL,\'unknown\',t_1.currency) currency,\n                                                                          if(t_1.amount=\'\'\n                                                                             OR t_1.amount IS NULL,\'0\',t_1.amount) amount,\n                                                                          if(t_1.value2=\'\'\n                                                                             OR t_1.value2 IS NULL,\'0\',t_1.value2) value2,\n                                                                             if(download_from IS NULL,\'unknown\', download_from) download_from,\n                                                                             if(ratio IS NULL,\'unknown\', ratio) ratio,\n                                                                          if(t_1.status =\'\'\n                                                                             OR t_1.status IS NULL,\'unknown\',t_1.status) status,\n                                                                          if(t_1.transactionid = \'\'\n                                                                             OR t_1.transactionid IS NULL,\'unknown\',t_1.transactionid) transactionid,\n                                                                          if(provider =\'\' or provider IS NULL,\'unknown\',provider) provider,\n                                                                          if(ip =\'\' or ip IS NULL,\'unknown\',ip) ip,\n                                                                          if(kingdom = \'\' or kingdom IS NULL,\'unknown\',kingdom) kingdom,\n                                                                          if(phylum = \'\' or phylum IS NULL,\'unknown\',phylum) phylum,\n                                                                          paymentdate,\n                                                                          paymenttime,\n                                                                          if(client_version =\'\' or client_version IS NULL,\'unknown\',client_version) client_version,\n                                                                          if(phone_version =\'\' or phone_version IS NULL,\'unknown\',phone_version) phone_version,\n                                                                          if(phone_type=\'\' or phone_type IS NULL,\'unknown\', phone_type) phone_type,\n                                                                          if(service =\'\' or service IS NULL,\'unknown\', service) service\n                                                                          \n                                                                          \nFROM\n  (SELECT *\n   FROM\n     (SELECT *,\n             row_number() OVER(PARTITION BY userid,paymenttime,paymentdate ) indexs\n      FROM rawdatas.payment\n      WHERE snid=$snid\n        AND gameid=$gameid\n        AND ds=\'$ds\'\n        AND status!=\'fail\' ) clean_pay\n   WHERE indexs=1) t_1\nJOIN\n  (SELECT *\n   FROM\n     (SELECT *,\n             row_number() OVER(PARTITION BY userid\n                               ORDER BY installdate,installtime DESC) indexs\n      FROM rawdatas.install LATERAL VIEW json_tuple(extra,\'client_version\',\'phone_version\',\'phone_type\',\'service\',\'download_from\',\'ratio\') json_extra AS client_version,\n                                         phone_version,\n                                         phone_type,\n                                         service,\n                                         download_from,\n                                         ratio\n      WHERE snid=$snid\n        AND gameid=$gameid\n        AND ds<=\'$ds\' ) clean_install\n   WHERE indexs=1) t_2 ON t_1.userid =t_2.userid;\n   \n   INSERT OVERWRITE table etl_dailyreport.cleaned_online_duration PARTITION(snid=$snid,gameid=$gameid,ds=\'$ds\')\nSELECT \n          CASE\n              WHEN if(total_time >= \'0\' AND total_time < \'60\',\'60\',total_time)=\'60\' THEN \'0-1分钟\'\n              WHEN if(total_time>=\'60\'\n                      AND total_time<\'300\',\'300\',total_time)=\'300\' THEN \'1-5分钟\'\n              WHEN if(total_time>=\'300\'\n                      AND total_time<\'600\',\'600\',total_time)=\'600\' THEN \'5-10分钟\'\n              WHEN if(total_time>=\'600\'\n                      AND total_time<\'1200\',\'1200\',total_time)=\'1200\' THEN \'10-20分钟\'\n              WHEN if(total_time>=\'1200\'\n                      AND total_time<\'1800\',\'1800\',total_time)=\'1800\' THEN \'20-30分钟\'\n               ELSE \'大于30分钟\'\n          END AS TYPE,userid\n   FROM\n     (SELECT ds,\n             userid,\n             sum(t_3.time) total_time\n      FROM\n        (SELECT ds,\n                userid,kingdom, (unix_timestamp(max_time)-unix_timestamp(min_time)) TIME\n         FROM\n           (SELECT ds,\n                   userid,\n                   kingdom,\n                   max(concat(counterdate,\' \',countertime)) max_time,\n                   min(concat(counterdate,\' \',countertime)) min_time\n            FROM rawdatas.counter\n            WHERE counter=\'heartBeat\'\n              AND snid=$snid\n              AND gameid=$gameid\n              AND ds=\'$ds\'\n            GROUP BY userid,\n                     kingdom,\n                     ds) t_1\n         GROUP BY userid,\n                  kingdom,\n                  max_time,\n                  min_time,\n                  ds) t_3\n      GROUP BY userid,\n               ds) t_4');
INSERT INTO `engine_etls` VALUES (2, 'daily', 2, '留存', 'test', '2019-08-30 16:51:51', '2019-08-30 16:51:53', 0, 0, 'retention', 'INSERT OVERWRITE TABLE etl_dailyreport.retention PARTITION (snid=$snid,gameid=$gameid,ds=\'$ds\') \nSELECT datediff(t_2.ds,t_1.start_ds) dr,\n       count(DISTINCT t_1.userid)\nFROM\n  (SELECT ds start_ds,userid\n   FROM rawdatas.install\n   WHERE snid=$snid\n     AND gameid=$gameid\n     AND ds<\'$ds\'          \n     AND ds>=date_sub(\'$ds\',30)) AS t_1\nJOIN\n  (SELECT ds,\n          userid\n   FROM dau\n   WHERE snid=$snid\n     AND gameid=$gameid\n     AND ds=\'$ds\'\n     ) AS t_2 ON t_1.userid=t_2.userid\nGROUP BY t_1.start_ds,t_2.ds;\nINSERT OVERWRITE TABLE etl_dailyreport.retention_os PARTITION (snid=$snid,gameid=$gameid,ds=\'$ds\') \nSELECT if(t_1.source is NULL or t_1.source =\'\',\'unknown\',t_1.source) source,\n		datediff(t_2.ds,t_1.start_ds) dr,\n       count(DISTINCT t_1.userid)\nFROM\n  (SELECT ds start_ds,userid,source\n   FROM rawdatas.install\n   WHERE snid=$snid\n     AND gameid=$gameid\n     AND ds<\'$ds\'          \n     AND ds>=date_sub(\'$ds\',30)) AS t_1\nJOIN\n  (SELECT ds,source,\n          userid\n   FROM dau\n   WHERE snid=$snid\n     AND gameid=$gameid\n     AND ds=\'$ds\'\n     ) AS t_2 ON t_1.userid=t_2.userid \nGROUP BY t_1.start_ds,t_2.ds,t_1.source;\nINSERT OVERWRITE TABLE etl_dailyreport.retention_os_client PARTITION (snid=$snid,gameid=$gameid,ds=\'$ds\')\nSELECT if(t_1.source is NULL or t_1.source =\'\',\'unknown\',t_1.source) source,\n		if(t_1.clientid is NULL or t_1.clientid =\'\',\'unknown\',t_1.clientid) clientid,\n		datediff(t_2.ds,t_1.start_ds) dr,\n       count(DISTINCT t_1.userid)\nFROM\n  (SELECT ds start_ds,userid,source,clientid\n   FROM rawdatas.install\n   WHERE snid=$snid\n     AND gameid=$gameid\n     AND ds<\'$ds\'          \n     AND ds>=date_sub(\'$ds\',30)) AS t_1\nJOIN\n  (SELECT ds,source,clientid,\n          userid\n   FROM dau\n   WHERE snid=$snid\n     AND gameid=$gameid\n     AND ds=\'$ds\'\n     ) AS t_2 ON t_1.userid=t_2.userid \nGROUP BY t_1.start_ds,t_2.ds,t_1.source,t_1.clientid;\nINSERT OVERWRITE TABLE etl_dailyreport.retention_os_creative PARTITION (snid=$snid,gameid=$gameid,ds=\'$ds\')\nSELECT \n       if(t_1.source is NULL or t_1.source =\'\',\'unknown\',t_1.source) source,\n       if(t_1.creative is NULL or t_1.creative =\'\',\'unknown\',t_1.creative) creative,\n       datediff(t_2.ds,t_1.start_ds) dr,\n       count(DISTINCT t_1.userid)\nFROM\n  (SELECT ds start_ds,\n          userid,\n          SOURCE,\n          creative\n   FROM rawdatas.install\n   WHERE snid=$snid\n     AND gameid=$gameid\n     AND ds<\'$ds\'          \n     AND ds>=date_sub(\'$ds\',30)) AS t_1\nJOIN\n  (SELECT ds,\n          SOURCE,\n          creative,\n          userid\n   FROM dau\n   WHERE snid=$snid\n     AND gameid=$gameid\n     AND ds=\'$ds\') AS t_2 ON t_1.userid=t_2.userid \nGROUP BY t_1.start_ds,\n         t_2.ds,\n         t_1.source,\n         t_1.creative;');
INSERT INTO `engine_etls` VALUES (3, 'daily', 2, '日报', 'test', '2019-08-30 17:27:17', '2019-08-30 17:27:19', 0, 0, 'daily_status', 'INSERT OVERWRITE TABLE etl_dailyreport.daily_stats PARTITION(snid=$snid,gameid=$gameid,ds=\'$ds\')\nSELECT \n       t_1.dau_num dau_num,\n       t_2.install_num install_num,\n       t_3.pay_count pay_count,\n       t_3.value pay_amount,\n       t_3.pay_times pay_times,\n       t_4.pay_count pay_install_count,\n       t_4.value pay_install_amount,\n       t_4.pay_times pay_install_times,\n       t_7.new_pay_count new_pay_count,\n       t_7.new_pay_amount new_pay_amount,\n       t_7.new_pay_times new_pay_times\n       \nFROM\n  (SELECT ds,\n          count(DISTINCT userid) dau_num\n   FROM etl_dailyreport.cleaned_dau\n   WHERE snid=$snid\n     AND gameid=$gameid\n     AND ds=\'$ds\'\n   GROUP BY ds) t_1\nLEFT JOIN\n  ( SELECT ds,\n           count(DISTINCT userid) install_num\n   FROM install\n   WHERE snid=$snid\n     AND gameid=$gameid\n     AND ds=\'$ds\'\n   GROUP BY ds) t_2 ON t_1.ds = t_2.ds\nLEFT JOIN\n  (SELECT ds,\n          count(userid) pay_times,\n          count(DISTINCT userid) pay_count,\n          sum(amount) value\n   FROM etl_dailyreport.cleaned_payment\n   WHERE snid=$snid\n     AND gameid=$gameid\n     AND ds=\'$ds\'\n   GROUP BY ds) t_3 ON t_1.ds = t_3.ds\nLEFT JOIN\n  (SELECT ds,\n          count(userid) pay_times,\n          count(DISTINCT userid) pay_count,\n          sum(amount) value\n   FROM etl_dailyreport.cleaned_payment\n   WHERE snid=$snid\n     AND gameid=$gameid\n     AND ds=\'$ds\'\n     AND userid IN\n       (SELECT i.userid\n        FROM install i\n        WHERE i.snid=$snid\n          AND i.gameid=$gameid\n          AND i.ds=\'$ds\')\n   GROUP BY ds) t_4 ON t_1.ds = t_4.ds\nLEFT JOIN(\n    SELECT ds,count(t_5.userid) new_pay_times,sum(amount) new_pay_amount ,count(DISTINCT t_5.userid) new_pay_count\nFROM\n  (SELECT ds,userid,\n          amount\n   FROM etl_dailyreport.cleaned_payment\n   WHERE snid=$snid\n     AND gameid=$gameid\n     AND ds=\'$ds\' ) t_5 LEFT \nJOIN\n  (SELECT userid\n   FROM etl_dailyreport.cleaned_payment\n   WHERE snid=$snid\n   AND gameid=$gameid\n   AND ds<\'$ds\') t_6 on t_5.userid=t_6.userid\n   WHERE\n   t_6.userid IS NULL\n  GROUP BY ds\n) t_7 ON t_1.ds=t_7.ds;\n\n   \nINSERT OVERWRITE TABLE etl_dailyreport.daily_os_stats PARTITION(snid=$snid,gameid=$gameid,ds=\'$ds\')\nSELECT \n        t_1.source,\n       t_1.dau_num dau_num,\n       t_2.install_num install_num,\n       t_3.pay_count pay_count,\n       t_3.value pay_amount,\n       t_3.pay_times pay_times,\n       t_4.pay_count pay_install_count,\n       t_4.value pay_install_amount,\n       t_4.pay_times pay_install_times,\n       t_7.new_pay_count new_pay_count,\n       t_7.new_pay_amount new_pay_amount,\n       t_7.new_pay_times new_pay_times\nFROM\n  (SELECT source,\n          count(DISTINCT userid) dau_num\n   FROM etl_dailyreport.cleaned_dau\n   WHERE snid=$snid\n     AND gameid=$gameid\n     AND ds=\'$ds\'\n   GROUP BY source) t_1\nLEFT JOIN\n  ( SELECT if(source = \'\' or source is NULL,\'unknown\',source) source,\n           count(DISTINCT userid) install_num\n   FROM install\n   WHERE snid=$snid\n     AND gameid=$gameid\n     AND ds=\'$ds\'\n   GROUP BY source) t_2 ON t_1.source = t_2.source\nLEFT JOIN\n  (SELECT source,\n          count(userid) pay_times,\n          count(DISTINCT userid) pay_count,\n          sum(amount) value\n   FROM etl_dailyreport.cleaned_payment\n   WHERE snid=$snid\n     AND gameid=$gameid\n     AND ds=\'$ds\'\n   GROUP BY source) t_3 ON t_1.source = t_3.source\nLEFT JOIN\n  (SELECT source,\n          count(userid) pay_times,\n          count(DISTINCT userid) pay_count,\n          sum(amount) value\n   FROM etl_dailyreport.cleaned_payment\n   WHERE snid=$snid\n     AND gameid=$gameid\n     AND ds=\'$ds\'\n     AND userid IN\n       (SELECT i.userid\n        FROM install i\n        WHERE i.snid=$snid\n          AND i.gameid=$gameid\n          AND i.ds=\'$ds\')\n   GROUP BY source) t_4 ON t_1.source = t_4.source\nLEFT JOIN(\n    SELECT source,count(t_5.userid) new_pay_times,sum(amount) new_pay_amount ,count(DISTINCT t_5.userid) new_pay_count\nFROM\n  (SELECT source,userid,\n          amount\n   FROM etl_dailyreport.cleaned_payment\n   WHERE snid=$snid\n     AND gameid=$gameid\n     AND ds=\'$ds\' ) t_5 LEFT \nJOIN\n  (SELECT userid\n   FROM etl_dailyreport.cleaned_payment\n   WHERE snid=$snid\n   AND gameid=$gameid\n   AND ds<\'$ds\') t_6 on t_5.userid=t_6.userid\n   WHERE\n   t_6.userid IS NULL\n  GROUP BY source\n) t_7 ON t_1.source=t_7.source;\n\n\nINSERT OVERWRITE TABLE etl_dailyreport.daily_os_client_stats PARTITION(snid=$snid,gameid=$gameid,ds=\'$ds\')\nSELECT \n       t_1.source,\n       t_1.clientid,\n       t_1.dau_num dau_num,\n       t_2.install_num install_num,\n       t_3.pay_count pay_count,\n       t_3.value pay_amount,\n       t_3.pay_times pay_times,\n       t_4.pay_count pay_install_count,\n       t_4.value pay_install_amount,\n       t_4.pay_times pay_install_times,\n       t_7.new_pay_count new_pay_count,\n       t_7.new_pay_amount new_pay_amount,\n       t_7.new_pay_times new_pay_times\nFROM\n  (SELECT source,clientid,\n          count(DISTINCT userid) dau_num\n   FROM etl_dailyreport.cleaned_dau\n   WHERE snid=$snid\n     AND gameid=$gameid\n     AND ds=\'$ds\'\n   GROUP BY source,clientid) t_1\nLEFT JOIN\n  ( SELECT if(source = \'\' or source is NULL,\'unknown\',source) source,\n            if(clientid = \'\' or clientid is NULL,\'unknown\',clientid) clientid,\n           count(DISTINCT userid) install_num\n   FROM install\n   WHERE snid=$snid\n     AND gameid=$gameid\n     AND ds=\'$ds\'\n   GROUP BY source,clientid) t_2 ON t_1.source = t_2.source AND t_1.clientid=t_2.clientid\nLEFT JOIN\n  (SELECT source,clientid,\n          count(userid) pay_times,\n          count(DISTINCT userid) pay_count,\n          sum(amount) value\n   FROM etl_dailyreport.cleaned_payment\n   WHERE snid=$snid\n     AND gameid=$gameid\n     AND ds=\'$ds\'\n   GROUP BY source,clientid) t_3 ON t_1.source = t_3.source AND t_1.clientid=t_3.clientid\nLEFT JOIN\n  (SELECT source,\n          clientid,\n          count(userid) pay_times,\n          count(DISTINCT userid) pay_count,\n          sum(amount) value\n   FROM etl_dailyreport.cleaned_payment\n   WHERE snid=$snid\n     AND gameid=$gameid\n     AND ds=\'$ds\'\n     AND userid IN\n       (SELECT i.userid\n        FROM install i\n        WHERE i.snid=$snid\n          AND i.gameid=$gameid\n          AND i.ds=\'$ds\')\n   GROUP BY source,clientid) t_4 ON t_1.source = t_4.source AND t_1.clientid=t_4.clientid\nLEFT JOIN(\n    SELECT source,clientid,count(t_5.userid) new_pay_times,sum(amount) new_pay_amount ,count(DISTINCT t_5.userid) new_pay_count\nFROM\n  (SELECT source,clientid,userid,\n          amount\n   FROM etl_dailyreport.cleaned_payment\n   WHERE snid=$snid\n     AND gameid=$gameid\n     AND ds=\'$ds\' ) t_5 LEFT \nJOIN\n  (SELECT userid\n   FROM etl_dailyreport.cleaned_payment\n   WHERE snid=$snid\n   AND gameid=$gameid\n   AND ds<\'$ds\') t_6 on t_5.userid=t_6.userid\n   WHERE\n   t_6.userid IS NULL\n  GROUP BY source,clientid\n) t_7 ON t_1.source=t_7.source AND t_1.clientid=t_7.clientid;\n\n\nINSERT OVERWRITE TABLE etl_dailyreport.daily_os_creative_stats PARTITION(snid=$snid,gameid=$gameid,ds=\'$ds\')\nSELECT \n       t_1.source,\n       t_1.creative,\n       t_1.dau_num dau_num,\n       t_2.install_num install_num,\n       t_3.pay_count pay_count,\n       t_3.value pay_amount,\n       t_3.pay_times pay_times,\n       t_4.pay_count pay_install_count,\n       t_4.value pay_install_amount,\n       t_4.pay_times pay_install_times,\n       t_7.new_pay_count new_pay_count,\n       t_7.new_pay_amount new_pay_amount,\n       t_7.new_pay_times new_pay_times\nFROM\n  (SELECT source,\n          creative,\n          count(DISTINCT userid) dau_num\n   FROM etl_dailyreport.cleaned_dau\n   WHERE snid=$snid\n     AND gameid=$gameid\n     AND ds=\'$ds\'\n   GROUP BY source,creative) t_1\nLEFT JOIN\n  ( SELECT if(source = \'\' or source is NULL,\'unknown\',source) source,\n          if(creative = \'\' or creative is NULL,\'unknown\',creative) creative,\n           count(DISTINCT userid) install_num\n   FROM install\n   WHERE snid=$snid\n     AND gameid=$gameid\n     AND ds=\'$ds\'\n   GROUP BY source,creative) t_2 ON t_1.source = t_2.source AND t_1.creative=t_2.creative\nLEFT JOIN\n  (SELECT source,creative,\n          count(userid) pay_times,\n          count(DISTINCT userid) pay_count,\n          sum(amount) value\n   FROM etl_dailyreport.cleaned_payment\n   WHERE snid=$snid\n     AND gameid=$gameid\n     AND ds=\'$ds\'\n   GROUP BY source,creative) t_3 ON t_1.source = t_3.source AND t_1.creative=t_3.creative\nLEFT JOIN\n  (SELECT source,\n          creative,\n          count(userid) pay_times,\n          count(DISTINCT userid) pay_count,\n          sum(amount) value\n   FROM etl_dailyreport.cleaned_payment\n   WHERE snid=$snid\n     AND gameid=$gameid\n     AND ds=\'$ds\'\n     AND userid IN\n       (SELECT i.userid\n        FROM install i\n        WHERE i.snid=$snid\n          AND i.gameid=$gameid\n          AND i.ds=\'$ds\')\n   GROUP BY source,creative) t_4 ON t_1.source = t_4.source AND t_1.creative=t_4.creative\nLEFT JOIN(\n    SELECT source,creative,count(t_5.userid) new_pay_times,sum(amount) new_pay_amount ,count(DISTINCT t_5.userid) new_pay_count\nFROM\n  (SELECT source,creative,userid,\n          amount\n   FROM etl_dailyreport.cleaned_payment\n   WHERE snid=$snid\n     AND gameid=$gameid\n     AND ds=\'$ds\' ) t_5 LEFT \nJOIN\n  (SELECT userid\n   FROM etl_dailyreport.cleaned_payment\n   WHERE snid=$snid\n   AND gameid=$gameid\n   AND ds<\'$ds\') t_6 on t_5.userid=t_6.userid\n   WHERE\n   t_6.userid IS NULL\n  GROUP BY source,creative\n) t_7 ON t_1.source=t_7.source AND t_1.creative=t_7.creative;');
INSERT INTO `engine_etls` VALUES (4, 'daily', 2, '留存（设备）', 'equip', '2019-08-31 15:47:32', '2019-08-31 15:47:34', 1, 0, 'retention_device', 'INSERT OVERWRITE TABLE etl_dailyreport.retention_device PARTITION (snid=$snid,gameid=$gameid,ds=\'$ds\')\nSELECT datediff(t_2.ds,t_1.start_ds) dr,\n       count(DISTINCT t_1.udid)\nFROM\n  (SELECT ds start_ds,udid\n   FROM install\n   WHERE snid=$snid\n     AND gameid=$gameid\n     AND ds<\'$ds\'          \n     AND ds>=date_sub(\'$ds\',30)) AS t_1\nJOIN\n  (SELECT ds,\n          udid\n   FROM dau\n   WHERE snid=$snid\n     AND gameid=$gameid\n     AND ds=\'$ds\'\n     ) AS t_2 ON t_1.udid=t_2.udid\nGROUP BY t_1.start_ds,t_2.ds;\nINSERT OVERWRITE TABLE etl_dailyreport.retention_os_device PARTITION (snid=$snid,gameid=$gameid,ds=\'$ds\')\nSELECT if(t_1.source is NULL or t_1.source =\'\',\'unknown\',t_1.source) source,\n		datediff(t_2.ds,t_1.start_ds) dr,\n       count(DISTINCT t_1.udid)\nFROM\n  (SELECT ds start_ds,udid,source\n   FROM install\n   WHERE snid=$snid\n     AND gameid=$gameid\n     AND ds<\'$ds\'          \n     AND ds>=date_sub(\'$ds\',30)) AS t_1\nJOIN\n  (SELECT ds,source,\n          udid\n   FROM dau\n   WHERE snid=$snid\n     AND gameid=$gameid\n     AND ds=\'$ds\'\n     ) AS t_2 ON t_1.udid=t_2.udid \nGROUP BY t_1.start_ds,t_2.ds,t_1.source;\nINSERT OVERWRITE TABLE etl_dailyreport.retention_os_client_device PARTITION (snid=$snid,gameid=$gameid,ds=\'$ds\')\nSELECT if(t_1.source is NULL or t_1.source =\'\',\'unknown\',t_1.source) source,\n		if(t_1.clientid is NULL or t_1.clientid =\'\',\'unknown\',t_1.clientid) clientid,\ndatediff(t_2.ds,t_1.start_ds) dr,\n       count(DISTINCT t_1.udid)\nFROM\n  (SELECT ds start_ds,udid,source,clientid\n   FROM install\n   WHERE snid=$snid\n     AND gameid=$gameid\n     AND ds<\'$ds\'          \n     AND ds>=date_sub(\'$ds\',30)) AS t_1\nJOIN\n  (SELECT ds,source,clientid,\n          udid\n   FROM dau\n   WHERE snid=$snid\n     AND gameid=$gameid\n     AND ds=\'$ds\'\n     ) AS t_2 ON t_1.udid=t_2.udid \nGROUP BY t_1.start_ds,t_2.ds,t_1.source,t_1.clientid;\nINSERT OVERWRITE TABLE etl_dailyreport.retention_os_creative_device PARTITION (snid=$snid,gameid=$gameid,ds=\'$ds\')\nSELECT \n       if(t_1.source is NULL or t_1.source =\'\',\'unknown\',t_1.source) source,\n       if(t_1.creative is NULL or t_1.creative =\'\',\'unknown\',t_1.creative) creative,\n       datediff(t_2.ds,t_1.start_ds) dr,\n       count(DISTINCT t_1.udid)\nFROM\n  (SELECT ds start_ds,\n          udid,\n          SOURCE,\n          creative\n   FROM install\n   WHERE snid=$snid\n     AND gameid=$gameid\n     AND ds<\'$ds\'          \n     AND ds>=date_sub(\'$ds\',30)) AS t_1\nJOIN\n  (SELECT ds,\n          SOURCE,\n          creative,\n          udid\n   FROM dau\n   WHERE snid=$snid\n     AND gameid=$gameid\n     AND ds=\'$ds\') AS t_2 ON t_1.udid=t_2.udid \nGROUP BY t_1.start_ds,\n         t_2.ds,\n         t_1.source,\n         t_1.creative');
INSERT INTO `engine_etls` VALUES (5, 'daily', 2, ' 日报（设备）', 'equip', '2019-08-31 15:51:26', '2019-08-31 15:51:28', 1, 0, 'daily_stats_device', 'INSERT OVERWRITE TABLE etl_dailyreport.daily_stats_device PARTITION(snid=$snid,gameid=$gameid,ds=\'$ds\')\nSELECT \n       t_1.dau_num dau_num,\n       t_2.install_num install_num,\n       t_3.pay_count pay_count,\n       t_3.value pay_amount,\n       t_3.pay_times pay_times,\n       t_4.pay_count pay_install_count,\n       t_4.value pay_install_amount,\n       t_4.pay_times pay_install_times,\n       t_7.new_pay_count new_pay_count,\n       t_7.new_pay_amount new_pay_amount,\n       t_7.new_pay_times new_pay_times\n       \nFROM\n  (SELECT ds,\n          count(DISTINCT udid) dau_num\n   FROM etl_dailyreport.cleaned_dau\n   WHERE snid=$snid\n     AND gameid=$gameid\n     AND ds=\'$ds\'\n   GROUP BY ds) t_1\nLEFT JOIN\n  ( SELECT ds,\n           count(DISTINCT udid) install_num\n   FROM install\n   WHERE snid=$snid\n     AND gameid=$gameid\n     AND ds=\'$ds\'\n   GROUP BY ds) t_2 ON t_1.ds = t_2.ds\nLEFT JOIN\n  (SELECT ds,\n          count(udid) pay_times,\n          count(DISTINCT udid) pay_count,\n          sum(amount) value\n   FROM etl_dailyreport.cleaned_payment\n   WHERE snid=$snid\n     AND gameid=$gameid\n     AND ds=\'$ds\'\n   GROUP BY ds) t_3 ON t_1.ds = t_3.ds\nLEFT JOIN\n  (SELECT ds,\n          count(udid) pay_times,\n          count(DISTINCT udid) pay_count,\n          sum(amount) value\n   FROM etl_dailyreport.cleaned_payment\n   WHERE snid=$snid\n     AND gameid=$gameid\n     AND ds=\'$ds\'\n     AND udid IN\n       (SELECT i.udid\n        FROM install i\n        WHERE i.snid=$snid\n          AND i.gameid=$gameid\n          AND i.ds=\'$ds\')\n   GROUP BY ds) t_4 ON t_1.ds = t_4.ds\nLEFT JOIN(\n    SELECT ds,count(t_5.udid) new_pay_times,sum(amount) new_pay_amount ,count(DISTINCT t_5.udid) new_pay_count\nFROM\n  (SELECT ds,udid,\n          amount\n   FROM etl_dailyreport.cleaned_payment\n   WHERE snid=$snid\n     AND gameid=$gameid\n     AND ds=\'$ds\' ) t_5 LEFT \nJOIN\n  (SELECT udid\n   FROM etl_dailyreport.cleaned_payment\n   WHERE snid=$snid\n   AND gameid=$gameid\n   AND ds<\'$ds\') t_6 on t_5.udid=t_6.udid\n   WHERE\n   t_6.udid IS NULL\n  GROUP BY ds\n) t_7 ON t_1.ds=t_7.ds;\n\n   \nINSERT OVERWRITE TABLE etl_dailyreport.daily_os_stats_device PARTITION(snid=$snid,gameid=$gameid,ds=\'$ds\')\nSELECT \n       t_1.source,\n       t_1.dau_num dau_num,\n       t_2.install_num install_num,\n       t_3.pay_count pay_count,\n       t_3.value pay_amount,\n       t_3.pay_times pay_times,\n       t_4.pay_count pay_install_count,\n       t_4.value pay_install_amount,\n       t_4.pay_times pay_install_times,\n       t_7.new_pay_count new_pay_count,\n       t_7.new_pay_amount new_pay_amount,\n       t_7.new_pay_times new_pay_times\nFROM\n  (SELECT if(source = \'\' or source is NULL,\'unknown\',source) source,\n          count(DISTINCT udid) dau_num\n   FROM etl_dailyreport.cleaned_dau\n   WHERE snid=$snid\n     AND gameid=$gameid\n     AND ds=\'$ds\'\n   GROUP BY source) t_1\nLEFT JOIN\n  ( SELECT source,\n           count(DISTINCT udid) install_num\n   FROM install\n   WHERE snid=$snid\n     AND gameid=$gameid\n     AND ds=\'$ds\'\n   GROUP BY source) t_2 ON t_1.source = t_2.source\nLEFT JOIN\n  (SELECT source,\n          count(udid) pay_times,\n          count(DISTINCT udid) pay_count,\n          sum(amount) value\n   FROM etl_dailyreport.cleaned_payment\n   WHERE snid=$snid\n     AND gameid=$gameid\n     AND ds=\'$ds\'\n   GROUP BY source) t_3 ON t_1.source = t_3.source\nLEFT JOIN\n  (SELECT source,\n          count(udid) pay_times,\n          count(DISTINCT udid) pay_count,\n          sum(amount) value\n   FROM etl_dailyreport.cleaned_payment\n   WHERE snid=$snid\n     AND gameid=$gameid\n     AND ds=\'$ds\'\n     AND udid IN\n       (SELECT i.udid\n        FROM install i\n        WHERE i.snid=$snid\n          AND i.gameid=$gameid\n          AND i.ds=\'$ds\')\n   GROUP BY source) t_4 ON t_1.source = t_4.source\nLEFT JOIN(\n    SELECT source,count(t_5.udid) new_pay_times,sum(amount) new_pay_amount ,count(DISTINCT t_5.udid) new_pay_count\nFROM\n  (SELECT source,udid,\n          amount\n   FROM etl_dailyreport.cleaned_payment\n   WHERE snid=$snid\n     AND gameid=$gameid\n     AND ds=\'$ds\' ) t_5 LEFT \nJOIN\n  (SELECT udid\n   FROM etl_dailyreport.cleaned_payment\n   WHERE snid=$snid\n   AND gameid=$gameid\n   AND ds<\'$ds\') t_6 on t_5.udid=t_6.udid\n   WHERE\n   t_6.udid IS NULL\n  GROUP BY source\n) t_7 ON t_1.source=t_7.source;\n\n\nINSERT OVERWRITE TABLE etl_dailyreport.daily_os_client_stats_device PARTITION(snid=$snid,gameid=$gameid,ds=\'$ds\')\nSELECT \n       t_1.source,\n       t_1.clientid,\n       t_1.dau_num dau_num,\n       t_2.install_num install_num,\n       t_3.pay_count pay_count,\n       t_3.value pay_amount,\n       t_3.pay_times pay_times,\n       t_4.pay_count pay_install_count,\n       t_4.value pay_install_amount,\n       t_4.pay_times pay_install_times,\n       t_7.new_pay_count new_pay_count,\n       t_7.new_pay_amount new_pay_amount,\n       t_7.new_pay_times new_pay_times\nFROM\n  (SELECT if(source = \'\' or source is NULL,\'unknown\',source) source,\n        if(clientid = \'\' or clientid is NULL,\'unknown\',clientid) clientid,\n          count(DISTINCT udid) dau_num\n   FROM etl_dailyreport.cleaned_dau\n   WHERE snid=$snid\n     AND gameid=$gameid\n     AND ds=\'$ds\'\n   GROUP BY source,clientid) t_1\nLEFT JOIN\n  ( SELECT source,clientid,\n           count(DISTINCT udid) install_num\n   FROM install\n   WHERE snid=$snid\n     AND gameid=$gameid\n     AND ds=\'$ds\'\n   GROUP BY source,clientid) t_2 ON t_1.source = t_2.source AND t_1.clientid=t_2.clientid\nLEFT JOIN\n  (SELECT source,clientid,\n          count(udid) pay_times,\n          count(DISTINCT udid) pay_count,\n          sum(amount) value\n   FROM etl_dailyreport.cleaned_payment\n   WHERE snid=$snid\n     AND gameid=$gameid\n     AND ds=\'$ds\'\n   GROUP BY source,clientid) t_3 ON t_1.source = t_3.source AND t_1.clientid=t_3.clientid\nLEFT JOIN\n  (SELECT source,\n          clientid,\n          count(udid) pay_times,\n          count(DISTINCT udid) pay_count,\n          sum(amount) value\n   FROM etl_dailyreport.cleaned_payment\n   WHERE snid=$snid\n     AND gameid=$gameid\n     AND ds=\'$ds\'\n     AND udid IN\n       (SELECT i.udid\n        FROM install i\n        WHERE i.snid=$snid\n          AND i.gameid=$gameid\n          AND i.ds=\'$ds\')\n   GROUP BY source,clientid) t_4 ON t_1.source = t_4.source AND t_1.clientid=t_4.clientid\nLEFT JOIN(\n    SELECT source,clientid,count(t_5.udid) new_pay_times,sum(amount) new_pay_amount ,count(DISTINCT t_5.udid) new_pay_count\nFROM\n  (SELECT source,clientid,udid,\n          amount\n   FROM etl_dailyreport.cleaned_payment\n   WHERE snid=$snid\n     AND gameid=$gameid\n     AND ds=\'$ds\' ) t_5 LEFT \nJOIN\n  (SELECT udid\n   FROM etl_dailyreport.cleaned_payment\n   WHERE snid=$snid\n   AND gameid=$gameid\n   AND ds<\'$ds\') t_6 on t_5.udid=t_6.udid\n   WHERE\n   t_6.udid IS NULL\n  GROUP BY source,clientid\n) t_7 ON t_1.source=t_7.source AND t_1.clientid=t_7.clientid;\n\n\nINSERT OVERWRITE TABLE etl_dailyreport.daily_os_creative_stats_device PARTITION(snid=$snid,gameid=$gameid,ds=\'$ds\')\nSELECT \n       t_1.source,\n       t_1.creative,\n       t_1.dau_num dau_num,\n       t_2.install_num install_num,\n       t_3.pay_count pay_count,\n       t_3.value pay_amount,\n       t_3.pay_times pay_times,\n       t_4.pay_count pay_install_count,\n       t_4.value pay_install_amount,\n       t_4.pay_times pay_install_times,\n       t_7.new_pay_count new_pay_count,\n       t_7.new_pay_amount new_pay_amount,\n       t_7.new_pay_times new_pay_times\nFROM\n  (SELECT source,\n        creative,\n          count(DISTINCT udid) dau_num\n   FROM etl_dailyreport.cleaned_dau\n   WHERE snid=$snid\n     AND gameid=$gameid\n     AND ds=\'$ds\'\n   GROUP BY source,creative) t_1\nLEFT JOIN\n  ( SELECT if(source = \'\' or source is NULL,\'unknown\',source) source,\n        if(creative = \'\' or creative is NULL,\'unknown\',creative) creative,\n           count(DISTINCT udid) install_num\n   FROM install\n   WHERE snid=$snid\n     AND gameid=$gameid\n     AND ds=\'$ds\'\n   GROUP BY source,creative) t_2 ON t_1.source = t_2.source AND t_1.creative=t_2.creative\nLEFT JOIN\n  (SELECT source,creative,\n          count(udid) pay_times,\n          count(DISTINCT udid) pay_count,\n          sum(amount) value\n   FROM etl_dailyreport.cleaned_payment\n   WHERE snid=$snid\n     AND gameid=$gameid\n     AND ds=\'$ds\'\n   GROUP BY source,creative) t_3 ON t_1.source = t_3.source AND t_1.creative=t_3.creative\nLEFT JOIN\n  (SELECT source,\n          creative,\n          count(udid) pay_times,\n          count(DISTINCT udid) pay_count,\n          sum(amount) value\n   FROM etl_dailyreport.cleaned_payment\n   WHERE snid=$snid\n     AND gameid=$gameid\n     AND ds=\'$ds\'\n     AND udid IN\n       (SELECT i.udid\n        FROM install i\n        WHERE i.snid=$snid\n          AND i.gameid=$gameid\n          AND i.ds=\'$ds\')\n   GROUP BY source,creative) t_4 ON t_1.source = t_4.source AND t_1.creative=t_4.creative\nLEFT JOIN(\n    SELECT source,creative,count(t_5.udid) new_pay_times,sum(amount) new_pay_amount ,count(DISTINCT t_5.udid) new_pay_count\nFROM\n  (SELECT source,creative,udid,\n          amount\n   FROM etl_dailyreport.cleaned_payment\n   WHERE snid=$snid\n     AND gameid=$gameid\n     AND ds=\'$ds\' ) t_5 LEFT \nJOIN\n  (SELECT udid\n   FROM etl_dailyreport.cleaned_payment\n   WHERE snid=$snid\n   AND gameid=$gameid\n   AND ds<\'$ds\') t_6 on t_5.udid=t_6.udid\n   WHERE\n   t_6.udid IS NULL\n  GROUP BY source,creative\n) t_7 ON t_1.source=t_7.source AND t_1.creative=t_7.creative;');
INSERT INTO `engine_etls` VALUES (6, 'daily', 2, '注收比', 'test', '2019-09-23 16:15:54', '2019-09-23 16:15:58', 0, 0, 'registered_income_ratio', 'INSERT OVERWRITE TABLE etl_dailyreport.install_income_ratio PARTITION(snid=$snid,gameid=$gameid,ds=\'$ds\')\nSELECT t_2.ds install_ds,\n       sum(amount) amount\nFROM\n  (SELECT userid,\n          amount\n   FROM etl_dailyreport.cleaned_payment\n   WHERE snid=$snid\n     AND gameid=$gameid\n     AND ds=\'$ds\' ) t_1\nJOIN\n  (SELECT userid,\n          collect_set(ds)[0] ds\n   FROM install\n   WHERE snid=$snid\n     AND gameid=$gameid\n     AND ds>=date_sub(\'$ds\',90)\n     AND ds<=\'$ds\'\n   GROUP BY userid) t_2 ON t_1.userid =t_2.userid\nGROUP BY t_2.ds;\n\nINSERT OVERWRITE TABLE etl_dailyreport.install_income_ratio_os PARTITION(snid=$snid,gameid=$gameid,ds=\'$ds\')\nSELECT \n                    t_2.source SOURCE,\n                    t_2.ds install_ds,\n       \n                  sum(amount) amount\nFROM\n  (SELECT userid,\n          amount\n   FROM etl_dailyreport.cleaned_payment\n   WHERE snid=$snid\n     AND gameid=$gameid\n     AND ds=\'$ds\' ) t_1\nJOIN\n  (SELECT userid,\n          collect_set(SOURCE)[0] SOURCE,\n                                 collect_set(ds)[0] ds\n   FROM install\n   WHERE snid=$snid\n     AND gameid=$gameid\n     AND ds>=date_sub(\'$ds\',90)\n     AND ds<=\'$ds\'\n   GROUP BY userid) t_2 ON t_1.userid =t_2.userid\nGROUP BY t_2.ds,\n         t_2.source;\nINSERT OVERWRITE TABLE etl_dailyreport.install_income_ratio_os_client PARTITION(snid=$snid,gameid=$gameid,ds=\'$ds\')\nSELECT \n       t_2.source SOURCE,\n       t_2.clientid clientid,\n       t_2.ds install_ds,\n        sum(amount) amount\nFROM\n  (SELECT userid,\n          amount\n   FROM etl_dailyreport.cleaned_payment\n   WHERE snid=$snid\n     AND gameid=$gameid\n     AND ds=\'$ds\' ) t_1\nJOIN\n  (SELECT userid,\n          collect_set(SOURCE)[0] SOURCE,\n          collect_set(clientid)[0] clientid,\n                                 collect_set(ds)[0] ds\n   FROM install\n   WHERE snid=$snid\n     AND gameid=$gameid\n     AND ds>=date_sub(\'$ds\',90)\n     AND ds<=\'$ds\'\n   GROUP BY userid) t_2 ON t_1.userid =t_2.userid\nGROUP BY t_2.ds,\n         t_2.source,\n         t_2.clientid;\nINSERT OVERWRITE TABLE etl_dailyreport.install_income_ratio_os_creative PARTITION(snid=$snid,gameid=$gameid,ds=\'$ds\')\nSELECT \n       t_2.source SOURCE,\n       t_2.creative creative,\n       t_2.ds install_ds,\n        sum(amount) amount\nFROM\n  (SELECT userid,\n          amount\n   FROM etl_dailyreport.cleaned_payment\n   WHERE snid=$snid\n     AND gameid=$gameid\n     AND ds=\'$ds\' ) t_1\nJOIN\n  (SELECT userid,\n          collect_set(SOURCE)[0] SOURCE,\n          collect_set(creative)[0] creative,\n                                 collect_set(ds)[0] ds\n   FROM install\n   WHERE snid=$snid\n     AND gameid=$gameid\n     AND ds>=date_sub(\'$ds\',90)\n     AND ds<=\'$ds\'\n   GROUP BY userid) t_2 ON t_1.userid =t_2.userid\nGROUP BY t_2.ds,\n         t_2.source,\n         t_2.creative;');
INSERT INTO `engine_etls` VALUES (7, 'daily', 2, '留存(新注册付费)', 'test', '2019-09-24 17:12:51', '2019-09-24 17:12:55', 0, 0, 'pay_install_retention', 'INSERT OVERWRITE TABLE etl_dailyreport.pay_install_retention PARTITION(snid=$snid,gameid=$gameid,ds=\'$ds\')\nSELECT datediff(\'$ds\',t_1.ds) dr,\n       count(DISTINCT t_1.userid)\nFROM\n  (SELECT ds,\n          userid\n   FROM install\n   WHERE snid=$snid\n     AND gameid=$gameid\n     AND ds<\'$ds\'\n     AND ds>=date_sub(\'$ds\',30) ) AS t_1\nJOIN\n  (SELECT userid,\n          ds\n   FROM etl_dailyreport.cleaned_payment\n   WHERE snid=$snid\n     AND gameid=$gameid\n     AND ds<\'$ds\'\n     AND ds>=date_sub(\'$ds\',30) ) t_2 ON t_1.userid=t_2.userid\nAND t_1.ds=t_2.ds\nJOIN\n  (SELECT userid\n   FROM rawdatas.dau\n   WHERE snid=$snid\n     AND gameid=$gameid\n     AND ds=\'$ds\') t_3 ON t_1.userid = t_3.userid\nGROUP BY t_1.ds;\n\nINSERT OVERWRITE TABLE etl_dailyreport.pay_install_retention_os PARTITION(snid=$snid,gameid=$gameid,ds=\'$ds\')\nSELECT t_1.source,\ndatediff(\'$ds\',t_1.ds) dr,\n       count(DISTINCT t_1.userid)\nFROM\n  (SELECT ds,source,\n          userid\n   FROM install\n   WHERE snid=1\n     AND gameid=1\n     AND ds<\'$ds\'\n     AND ds>=date_sub(\'$ds\',30) ) AS t_1\nJOIN\n  (SELECT userid,\n          ds\n   FROM etl_dailyreport.cleaned_payment\n   WHERE snid=1\n     AND gameid=1\n     AND ds<\'$ds\'\n     AND ds>=date_sub(\'$ds\',30) ) t_2 ON t_1.userid=t_2.userid\nAND t_1.ds=t_2.ds\nJOIN\n  (SELECT userid\n   FROM rawdatas.dau\n   WHERE snid=1\n     AND gameid=1\n     AND ds=\'$ds\') t_3 ON t_1.userid = t_3.userid\nGROUP BY t_1.ds,t_1.source;\n\nINSERT OVERWRITE TABLE etl_dailyreport.pay_install_retention_os_client PARTITION(snid=$snid,gameid=$gameid,ds=\'$ds\')\nSELECT t_1.source,t_1.clientid,datediff(\'$ds\',t_1.ds) dr,\n       count(DISTINCT t_1.userid)\nFROM\n  (SELECT ds,source,\n            clientid,\n          userid\n   FROM install\n   WHERE snid=1\n     AND gameid=1\n     AND ds<\'$ds\'\n     AND ds>=date_sub(\'$ds\',30) ) AS t_1\nJOIN\n  (SELECT userid,\n          ds\n   FROM etl_dailyreport.cleaned_payment\n   WHERE snid=1\n     AND gameid=1\n     AND ds<\'$ds\'\n     AND ds>=date_sub(\'$ds\',30) ) t_2 ON t_1.userid=t_2.userid\nAND t_1.ds=t_2.ds\nJOIN\n  (SELECT userid\n   FROM rawdatas.dau\n   WHERE snid=1\n     AND gameid=1\n     AND ds=\'$ds\') t_3 ON t_1.userid = t_3.userid\nGROUP BY t_1.ds,t_1.source,t_1.clientid;\n\nINSERT OVERWRITE TABLE etl_dailyreport.pay_install_retention_os_creative PARTITION(snid=$snid,gameid=$gameid,ds=\'$ds\')\nSELECT t_1.source,t_1.creative,datediff(\'$ds\',t_1.ds) dr,\n       count(DISTINCT t_1.userid)\nFROM\n  (SELECT ds,source,\n            creative,\n          userid\n   FROM install\n   WHERE snid=1\n     AND gameid=1\n     AND ds<\'$ds\'\n     AND ds>=date_sub(\'$ds\',30) ) AS t_1\nJOIN\n  (SELECT userid,\n          ds\n   FROM etl_dailyreport.cleaned_payment\n   WHERE snid=1\n     AND gameid=1\n     AND ds<\'$ds\'\n     AND ds>=date_sub(\'$ds\',30) ) t_2 ON t_1.userid=t_2.userid\nAND t_1.ds=t_2.ds\nJOIN\n  (SELECT userid\n   FROM rawdatas.dau\n   WHERE snid=1\n     AND gameid=1\n     AND ds=\'$ds\') t_3 ON t_1.userid = t_3.userid\nGROUP BY t_1.ds,t_1.source,t_1.creative;');
INSERT INTO `engine_etls` VALUES (8, 'daily', 2, '留存(新注册付费，设备)', 'equip', '2019-09-24 17:13:58', '2019-09-24 17:14:02', 1, 0, 'pay_install_retention_device', 'INSERT OVERWRITE TABLE etl_dailyreport.pay_install_retention_device PARTITION(snid=$snid,gameid=$gameid,ds=\'$ds\')\nSELECT datediff(\'$ds\',t_1.ds) dr,\n       count(DISTINCT t_1.udid)\nFROM\n  (SELECT ds,\n          udid\n   FROM install\n   WHERE snid=$snid\n     AND gameid=$gameid\n     AND ds<\'$ds\'\n     AND ds>=date_sub(\'$ds\',30) ) AS t_1\nJOIN\n  (SELECT udid,\n          ds\n   FROM etl_dailyreport.cleaned_payment\n   WHERE snid=$snid\n     AND gameid=$gameid\n     AND ds<\'$ds\'\n     AND ds>=date_sub(\'$ds\',30) ) t_2 ON t_1.udid=t_2.udid\nAND t_1.ds=t_2.ds\nJOIN\n  (SELECT udid\n   FROM dau\n   WHERE snid=$snid\n     AND gameid=$gameid\n     AND ds=\'$ds\') t_3 ON t_1.udid = t_3.udid\nGROUP BY t_1.ds;\n\nINSERT OVERWRITE TABLE etl_dailyreport.pay_install_retention_os_device PARTITION(snid=$snid,gameid=$gameid,ds=\'$ds\')\nSELECT t_1.source,datediff(\'$ds\',t_1.ds) dr,\n       count(DISTINCT t_1.udid)\nFROM\n  (SELECT ds,source,\n          udid\n   FROM install\n   WHERE snid=1\n     AND gameid=1\n     AND ds<\'$ds\'\n     AND ds>=date_sub(\'$ds\',30) ) AS t_1\nJOIN\n  (SELECT udid,\n          ds\n   FROM etl_dailyreport.cleaned_payment\n   WHERE snid=1\n     AND gameid=1\n     AND ds<\'$ds\'\n     AND ds>=date_sub(\'$ds\',30) ) t_2 ON t_1.udid=t_2.udid\nAND t_1.ds=t_2.ds\nJOIN\n  (SELECT udid\n   FROM dau\n   WHERE snid=1\n     AND gameid=1\n     AND ds=\'$ds\') t_3 ON t_1.udid = t_3.udid\nGROUP BY t_1.ds,t_1.source;\n\nINSERT OVERWRITE TABLE etl_dailyreport.pay_install_retention_os_client_device PARTITION(snid=$snid,gameid=$gameid,ds=\'$ds\')\nSELECT t_1.source,t_1.clientid,datediff(\'$ds\',t_1.ds) dr,\n       count(DISTINCT t_1.udid)\nFROM\n  (SELECT ds,source,\n            clientid,\n          udid\n   FROM install\n   WHERE snid=1\n     AND gameid=1\n     AND ds<\'$ds\'\n     AND ds>=date_sub(\'$ds\',30) ) AS t_1\nJOIN\n  (SELECT udid,\n          ds\n   FROM etl_dailyreport.cleaned_payment\n   WHERE snid=1\n     AND gameid=1\n     AND ds<\'$ds\'\n     AND ds>=date_sub(\'$ds\',30) ) t_2 ON t_1.udid=t_2.udid\nAND t_1.ds=t_2.ds\nJOIN\n  (SELECT udid\n   FROM dau\n   WHERE snid=1\n     AND gameid=1\n     AND ds=\'$ds\') t_3 ON t_1.udid = t_3.udid\nGROUP BY t_1.ds,t_1.source,t_1.clientid;\n\nINSERT OVERWRITE TABLE etl_dailyreport.pay_install_retention_os_creative_device PARTITION(snid=$snid,gameid=$gameid,ds=\'$ds\')\nSELECT t_1.source,t_1.creative,datediff(\'$ds\',t_1.ds) dr,\n       count(DISTINCT t_1.udid)\nFROM\n  (SELECT ds,source,\n            creative,\n          udid\n   FROM install\n   WHERE snid=1\n     AND gameid=1\n     AND ds<\'$ds\'\n     AND ds>=date_sub(\'$ds\',30) ) AS t_1\nJOIN\n  (SELECT udid,\n          ds\n   FROM etl_dailyreport.cleaned_payment\n   WHERE snid=1\n     AND gameid=1\n     AND ds<\'$ds\'\n     AND ds>=date_sub(\'$ds\',30) ) t_2 ON t_1.udid=t_2.udid\nAND t_1.ds=t_2.ds\nJOIN\n  (SELECT udid\n   FROM dau\n   WHERE snid=1\n     AND gameid=1\n     AND ds=\'$ds\') t_3 ON t_1.udid = t_3.udid\nGROUP BY t_1.ds,t_1.source,t_1.creative;');
INSERT INTO `engine_etls` VALUES (9, 'daily', 2, '留存（付费）', 'test', '2019-09-23 11:27:50', '2019-09-23 11:27:53', 0, 0, 'pay_retention', 'INSERT OVERWRITE TABLE etl_dailyreport.pay_retention PARTITION(snid=$snid,gameid=$gameid,ds=\'$ds\')\nSELECT datediff(\'$ds\',t_1.ds) dr,\n       count(DISTINCT t_1.userid)\nFROM\n\n  (SELECT *\n   FROM etl_dailyreport.cleaned_payment\n   WHERE snid=$snid\n     AND gameid=$gameid\n     AND ds<\'$ds\'\n     AND ds>=date_sub(\'$ds\',30) ) t_1\nJOIN\n  (SELECT userid\n   FROM dau\n   WHERE snid=$snid\n     AND gameid=$gameid\n     AND ds=\'$ds\') t_2 ON t_1.userid = t_2.userid\nGROUP BY t_1.ds;\n\nINSERT OVERWRITE TABLE etl_dailyreport.pay_retention_os PARTITION(snid=$snid,gameid=$gameid,ds=\'$ds\')\nSELECT t_1.source,\ndatediff(\'$ds\',t_1.ds) dr,\n       count(DISTINCT t_1.userid)\nFROM\n\n  (SELECT *\n   FROM etl_dailyreport.cleaned_payment\n   WHERE snid=1\n     AND gameid=1\n     AND ds<\'$ds\'\n     AND ds>=date_sub(\'$ds\',30) ) t_1 \nJOIN\n  (SELECT userid\n   FROM dau\n   WHERE snid=1\n     AND gameid=1\n     AND ds=\'$ds\') t_3 ON t_1.userid = t_3.userid\nGROUP BY t_1.ds,t_1.source;\n\nINSERT OVERWRITE TABLE etl_dailyreport.pay_retention_os_client PARTITION(snid=$snid,gameid=$gameid,ds=\'$ds\')\nSELECT t_1.source,t_1.clientid,datediff(\'$ds\',t_1.ds) dr,\n       count(DISTINCT t_1.userid)\nFROM\n\n  (SELECT *\n   FROM etl_dailyreport.cleaned_payment\n   WHERE snid=1\n     AND gameid=1\n     AND ds<\'$ds\'\n     AND ds>=date_sub(\'$ds\',30) ) t_1 \nJOIN\n  (SELECT userid\n   FROM dau\n   WHERE snid=1\n     AND gameid=1\n     AND ds=\'$ds\') t_3 ON t_1.userid = t_3.userid\nGROUP BY t_1.ds,t_1.source,t_1.clientid;\n\nINSERT OVERWRITE TABLE etl_dailyreport.pay_retention_os_creative PARTITION(snid=$snid,gameid=$gameid,ds=\'$ds\')\nSELECT t_1.source,t_1.creative,datediff(\'$ds\',t_1.ds) dr,\n       count(DISTINCT t_1.userid)\nFROM\n  (SELECT *\n   FROM etl_dailyreport.cleaned_payment\n   WHERE snid=1\n     AND gameid=1\n     AND ds<\'$ds\'\n     AND ds>=date_sub(\'$ds\',30) ) t_1 \nJOIN\n  (SELECT userid\n   FROM dau\n   WHERE snid=1\n     AND gameid=1\n     AND ds=\'$ds\') t_3 ON t_1.userid = t_3.userid\nGROUP BY t_1.ds,t_1.source,t_1.creative;');
INSERT INTO `engine_etls` VALUES (10, 'daily', 2, '留存（付费设备）', 'equip', '2019-09-25 15:33:26', '2019-09-25 15:33:30', 1, 0, 'pay_retention_device', 'INSERT OVERWRITE TABLE etl_dailyreport.pay_retention_device PARTITION(snid=$snid,gameid=$gameid,ds=\'$ds\')\nSELECT datediff(\'$ds\',t_1.ds) dr,\n       count(DISTINCT t_1.udid)\nFROM\n\n  (SELECT *\n   FROM etl_dailyreport.cleaned_payment\n   WHERE snid=$snid\n     AND gameid=$gameid\n     AND ds<\'$ds\'\n     AND ds>=date_sub(\'$ds\',30) ) t_1\nJOIN\n  (SELECT udid\n   FROM dau\n   WHERE snid=$snid\n     AND gameid=$gameid\n     AND ds=\'$ds\') t_3 ON t_1.udid = t_3.udid\nGROUP BY t_1.ds;\n\nINSERT OVERWRITE TABLE etl_dailyreport.pay_retention_os_device PARTITION(snid=$snid,gameid=$gameid,ds=\'$ds\')\nSELECT t_1.source,\ndatediff(\'$ds\',t_1.ds) dr,\n       count(DISTINCT t_1.udid)\nFROM\n  (SELECT *\n   FROM etl_dailyreport.cleaned_payment\n   WHERE snid=1\n     AND gameid=1\n     AND ds<\'$ds\'\n     AND ds>=date_sub(\'$ds\',30) ) t_1 \n\nJOIN\n  (SELECT udid\n   FROM dau\n   WHERE snid=1\n     AND gameid=1\n     AND ds=\'$ds\') t_3 ON t_1.udid = t_3.udid\nGROUP BY t_1.ds,t_1.source;\n\nINSERT OVERWRITE TABLE etl_dailyreport.pay_retention_os_client_device PARTITION(snid=$snid,gameid=$gameid,ds=\'$ds\')\nSELECT t_1.source,t_1.clientid,datediff(\'$ds\',t_1.ds) dr,\n       count(DISTINCT t_1.udid)\nFROM\n  (SELECT *\n   FROM etl_dailyreport.cleaned_payment\n   WHERE snid=1\n     AND gameid=1\n     AND ds<\'$ds\'\n     AND ds>=date_sub(\'$ds\',30) ) t_1\n\nJOIN\n  (SELECT udid\n   FROM dau\n   WHERE snid=1\n     AND gameid=1\n     AND ds=\'$ds\') t_3 ON t_1.udid = t_3.udid\nGROUP BY t_1.ds,t_1.source,t_1.clientid;\n\nINSERT OVERWRITE TABLE etl_dailyreport.pay_retention_os_creative_device PARTITION(snid=$snid,gameid=$gameid,ds=\'$ds\')\nSELECT t_1.source,t_1.creative,datediff(\'$ds\',t_1.ds) dr,\n       count(DISTINCT t_1.udid)\nFROM\n\n  (SELECT *\n   FROM etl_dailyreport.cleaned_payment\n   WHERE snid=1\n     AND gameid=1\n     AND ds<\'$ds\'\n     AND ds>=date_sub(\'$ds\',30) ) t_1\n\nJOIN\n  (SELECT udid\n   FROM dau\n   WHERE snid=1\n     AND gameid=1\n     AND ds=\'$ds\') t_3 ON t_1.udid = t_3.udid\nGROUP BY t_1.ds,t_1.source,t_1.creative;');
INSERT INTO `engine_etls` VALUES (11, 'daily', 2, '等级分布', 'test', '2019-10-18 15:29:32', '2019-10-18 15:29:36', 0, 0, 'level_distributions', 'INSERT OVERWRITE TABLE etl_dailyreport.level_distributions PARTITION (snid=$snid,gameid=$gameid,ds=\'$ds\')\nSELECT /*+ MAPJOIN(t_4) */ t_3.LEVEL LEVEL,\n                                     coalesce(t_4.numbers,0) install_level_numbers,\n                                     t_3.numbers dau_level_numbers,\n                                     coalesce(t_5.numbers,0) pay_level_numbers,\n                                     coalesce(t_6.numbers,0) pay_install_level_numbers,\n                                     coalesce(t_7.numbers,0) new_pay_level_numbers\nFROM\n  (SELECT /*+ MAPJOIN(p) */ ds,\n                            gameid,\n                            snid,\n                            LEVEL,\n                            count(DISTINCT m.userid) numbers\n   FROM (\n           SELECT ds,userid\n            FROM etl_dailyreport.cleaned_dau\n            WHERE ds = \'$ds\'\n              AND snid=$snid\n              AND gameid=$gameid) d\n         JOIN\n           (SELECT \n                   gameid,\n                   snid,\n                   userid,\n                   max(cast(value AS INT)) LEVEL\n            FROM rawdatas.milestone\n            WHERE milestone=\'dp\'\n              AND snid=$snid\n              AND ds <= \'$ds\'\n              AND gameid=$gameid\n            GROUP BY gameid,\n                     snid,\n                    \n                     userid) m ON d.userid = m.userid\n   GROUP BY gameid,\n            snid,\n            ds,\n            LEVEL) t_3\nLEFT JOIN\n  (SELECT ds,\n          count(DISTINCT t_1.userid) numbers,\n          LEVEL\n   FROM\n     (SELECT ds,\n             userid\n      FROM rawdatas.install\n      WHERE ds = \'$ds\'\n        AND snid=$snid\n        AND gameid=$gameid ) t_1\n   JOIN\n     (SELECT userid,\n             max(cast(value AS INT)) LEVEL\n      FROM rawdatas.milestone\n      WHERE ds = \'$ds\'\n        AND snid=$snid\n        AND gameid=$gameid\n        AND milestone=\'dp\'\n      GROUP BY userid) t_2 ON t_1.userid = t_2.userid\n   GROUP BY ds,\n            LEVEL) t_4 ON t_3.ds=t_4.ds\nAND t_3.LEVEL=t_4.LEVEL\nLEFT JOIN\n  (SELECT /*+ MAPJOIN(p) */ ds,\n                            count(DISTINCT p.userid) numbers,\n                            LEVEL\n   FROM\n     (SELECT ds,\n             userid\n      FROM etl_dailyreport.cleaned_payment\n      WHERE ds = \'$ds\'\n        AND snid=$snid\n        AND gameid=$gameid ) p\n   JOIN\n     (SELECT userid,\n             max(cast(value AS INT)) LEVEL\n      FROM rawdatas.milestone\n      WHERE snid=$snid\n        AND gameid=$gameid\n        AND ds <= \'$ds\'\n        AND milestone=\'dp\'\n      GROUP BY userid) m ON p.userid = m.userid\n   GROUP BY ds,\n            LEVEL) t_5 ON t_3.ds=t_5.ds\nAND t_3.LEVEL=t_5.LEVEL\nLEFT JOIN\n  (SELECT /*+ MAPJOIN(p) */ ds,\n                            count(DISTINCT p.userid) numbers,\n                            LEVEL\n   FROM\n     (SELECT ds,\n             userid\n      FROM etl_dailyreport.cleaned_payment\n      WHERE ds = \'$ds\'\n        AND snid=$snid\n        AND gameid=$gameid ) p\n   JOIN\n     (SELECT userid\n      FROM rawdatas.install\n      WHERE ds = \'$ds\'\n        AND snid=$snid\n        AND gameid=$gameid ) i ON p.userid=i.userid\n   JOIN\n     (SELECT userid,\n             max(cast(value AS INT)) LEVEL\n      FROM rawdatas.milestone\n      WHERE snid=$snid\n        AND gameid=$gameid\n        AND ds = \'$ds\'\n        AND milestone=\'dp\'\n      GROUP BY userid) m ON p.userid = m.userid\n   GROUP BY ds,\n            LEVEL) t_6 ON t_3.ds=t_6.ds\nAND t_3.LEVEL=t_6.LEVEL\nLEFT JOIN\n  (SELECT /*+ MAPJOIN(p) */ ds,\n                            count(DISTINCT p.userid) numbers,\n                            LEVEL\n   FROM\n     (SELECT ds,\n             userid\n      FROM etl_dailyreport.cleaned_payment\n      WHERE ds = \'$ds\'\n        AND snid=$snid\n        AND gameid=$gameid ) p\n   LEFT JOIN\n     (SELECT userid\n      FROM etl_dailyreport.cleaned_payment\n      WHERE ds < \'$ds\'\n        AND snid=$snid\n        AND gameid=$gameid ) p_1 ON p.userid=p_1.userid\n   JOIN\n     (SELECT userid,\n             max(cast(value AS INT)) LEVEL\n      FROM rawdatas.milestone\n      WHERE snid=$snid\n        AND gameid=$gameid\n        AND ds <= \'$ds\'\n        AND milestone=\'dp\'\n      GROUP BY userid) m ON p.userid = m.userid\n   WHERE p_1.userid IS NULL\n   GROUP BY ds,\n            LEVEL) t_7 ON t_3.ds=t_7.ds\nAND t_3.LEVEL=t_7.LEVEL');
INSERT INTO `engine_etls` VALUES (12, 'daily', 2, '等级变化趋势', 'test', '2019-10-18 16:46:23', '2019-10-18 16:46:27', 0, 0, 'level_change_legent', 'INSERT OVERWRITE TABLE etl_dailyreport.level_change_trend PARTITION (gameid=$gameid,snid=$snid,ds=\'$ds\')\nSELECT t_1.ds install_ds,\n       LEVEL,\n       count(DISTINCT t_1.userid) numbers\nFROM\n  (SELECT ds,\n          userid\n   FROM rawdatas.install\n   WHERE snid=$snid\n     AND gameid=$gameid\n     AND ds<=\'$ds\'\n     AND ds>date_sub(\'$ds\',15)) AS t_1\nINNER JOIN\n  (SELECT ds,\n          userid,\n          max(cast(value AS INT)) LEVEL\n   FROM rawdatas.milestone\n   WHERE snid=$snid\n     AND gameid=$gameid\n     AND ds=\'$ds\'\n     AND milestone=\'dp\'\n   GROUP BY ds,\n            userid) AS t_2 ON t_1.userid=t_2.userid\nGROUP BY t_1.ds,\n         LEVEL');
INSERT INTO `engine_etls` VALUES (13, 'daily', 2, '大r', 'test', '2019-11-01 11:59:51', '2019-11-01 11:59:56', 0, 0, 'rmb_player', 'INSERT INTO TABLE etl_dailyreport.rmb_player PARTITION(snid=$snid,gameid=$gameid,ds=\'$ds\')\nSELECT /*+mapjoin(t_3)*/ t_1.userid,ds, roleid, clientid, creative, SOURCE,amounts\nFROM\n  (SELECT /*+mapjoin(d)*/ c.userid\n   FROM\n     (SELECT userid,\n             sum(cast(amount AS INT))\n      FROM etl_dailyreport.cleaned_payment\n      WHERE snid=$snid\n        AND gameid=$gameid\n        AND ds<=\'$ds\'\n      GROUP BY userid\n      HAVING sum(cast(amount AS INT))/1000 >= 200) c LEFT SEMI\n   JOIN\n     (SELECT userid,\n             ds\n      FROM rawdatas.dau\n      WHERE snid=$snid\n        AND gameid=$gameid\n        AND ds=\'$ds\') d ON c.userid=d.userid\n   ) t_1\nLEFT JOIN\n     (SELECT * from\n        (SELECT ds,userid, row_number() OVER(PARTITION BY userid\n                                              ORDER BY installdate DESC) indexs, roleid, clientid, creative, SOURCE\n         FROM rawdatas.install\n         WHERE snid=$snid\n           AND gameid=$gameid\n           AND ds<=\'$ds\') sub_install\n      WHERE indexs=1 ) t_2 ON t_1.userid=t_2.userid\nLEFT JOIN\n  (SELECT userid,\n          sum(cast(amount AS INT)) amounts\n   FROM etl_dailyreport.cleaned_payment\n   WHERE snid=$snid\n     AND gameid=$gameid\n     AND ds=\'$ds\'\n   GROUP BY userid) t_3 ON t_1.userid = t_3.userid');
INSERT INTO `engine_etls` VALUES (14, 'daily', 2, '等级分布（操作系统）', 'test', '2019-11-11 15:36:05', '2019-11-11 15:36:09', 0, 0, 'level_distributions_os', 'INSERT OVERWRITE table etl_dailyreport.level_distributions_os PARTITION (snid=$snid,gameid=$gameid,ds=\'$ds\')\nSELECT /*+ MAPJOIN(t_4) */ t_3.source, t_3.LEVEL LEVEL,\n                                     coalesce(t_4.numbers,0) install_level_numbers,\n                                     t_3.numbers dau_level_numbers,\n                                     coalesce(t_5.numbers,0) pay_level_numbers,\n                                     coalesce(t_6.numbers,0) pay_install_level_numbers,\n                                     coalesce(t_7.numbers,0) new_pay_level_numbers\nFROM\n  (SELECT /*+ MAPJOIN(p) */ ds,\n                            gameid,\n                            snid,\n                            LEVEL,\n                            SOURCE,\n                            count(DISTINCT m.userid) numbers\n   FROM\n     (SELECT ds,\n             userid,\n             SOURCE\n      FROM etl_dailyreport.cleaned_dau\n      WHERE ds = \'$ds\'\n        AND snid=$snid\n        AND gameid=$gameid) d\n   JOIN\n     (SELECT gameid,\n             snid,\n             userid,\n             max(cast(value AS INT)) LEVEL\n      FROM rawdatas.milestone\n      WHERE milestone=\'dp\'\n        AND snid=$snid\n        AND ds<=$ds\n        AND gameid=$gameid\n      GROUP BY gameid,\n               snid,\n               userid) m ON d.userid = m.userid\n   GROUP BY gameid,\n            snid,\n            ds,\n            SOURCE,\n            LEVEL) t_3\nLEFT JOIN\n  (SELECT ds,\n          count(DISTINCT t_1.userid) numbers,\n          SOURCE,\n          LEVEL\n   FROM\n     (SELECT ds,\n             userid,\n             SOURCE\n      FROM rawdatas.install\n      WHERE ds = \'$ds\'\n        AND snid=$snid\n        AND gameid=$gameid ) t_1\n   JOIN\n     (SELECT userid,\n             max(cast(value AS INT)) LEVEL\n      FROM rawdatas.milestone\n      WHERE ds = \'$ds\'\n        AND snid=$snid\n        AND gameid=$gameid\n        AND milestone=\'dp\'\n      GROUP BY userid) t_2 ON t_1.userid = t_2.userid\n   GROUP BY ds,\n            LEVEL,\n            SOURCE) t_4 ON t_3.ds=t_4.ds\nAND t_3.LEVEL=t_4.LEVEL\nAND t_3.SOURCE = t_4.source\nLEFT JOIN\n  (SELECT /*+ MAPJOIN(p) */ ds,\n                            SOURCE,\n                            count(DISTINCT p.userid) numbers,\n                            LEVEL\n   FROM\n     (SELECT ds,\n             userid,\n             SOURCE\n      FROM etl_dailyreport.cleaned_payment\n      WHERE ds = \'$ds\'\n        AND snid=$snid\n        AND gameid=$gameid ) p\n   JOIN\n     (SELECT userid,\n             max(cast(value AS INT)) LEVEL\n      FROM rawdatas.milestone\n      WHERE snid=$snid\n        AND gameid=$gameid\n        AND ds<=$ds\n        AND milestone=\'dp\'\n      GROUP BY userid) m ON p.userid = m.userid\n   GROUP BY ds,\n            LEVEL,\n            SOURCE) t_5 ON t_3.ds=t_5.ds\nAND t_3.LEVEL=t_5.LEVEL\nAND t_3.SOURCE = t_5.source\nLEFT JOIN\n  (SELECT /*+ MAPJOIN(p) */ ds,\n                            SOURCE,\n                            count(DISTINCT p.userid) numbers,\n                            LEVEL\n   FROM\n     (SELECT ds,\n             userid\n      FROM etl_dailyreport.cleaned_payment\n      WHERE ds = \'$ds\'\n        AND snid=$snid\n        AND gameid=$gameid ) p\n   JOIN\n     (SELECT userid,\n             SOURCE\n      FROM rawdatas.install\n      WHERE ds = \'$ds\'\n        AND snid=$snid\n        AND gameid=$gameid ) i ON p.userid=i.userid\n   JOIN\n     (SELECT userid,\n             max(cast(value AS INT)) LEVEL\n      FROM rawdatas.milestone\n      WHERE snid=$snid\n        AND ds= \'$ds\'\n        AND gameid=$gameid\n        AND milestone=\'dp\'\n      GROUP BY userid) m ON p.userid = m.userid\n   GROUP BY ds,\n            LEVEL,\n            SOURCE) t_6 ON t_3.ds=t_6.ds\nAND t_3.LEVEL=t_6.LEVEL\nAND t_3.SOURCE = t_6.source\nLEFT JOIN\n  (SELECT /*+ MAPJOIN(p) */ ds,\n                            SOURCE,\n                            count(DISTINCT p.userid) numbers,\n                            LEVEL\n   FROM\n     (SELECT ds,\n             userid,\n             SOURCE\n      FROM etl_dailyreport.cleaned_payment\n      WHERE ds = \'$ds\'\n        AND snid=$snid\n        AND gameid=$gameid ) p\n   LEFT JOIN\n     (SELECT userid\n      FROM etl_dailyreport.cleaned_payment\n      WHERE ds < \'$ds\'\n        AND snid=$snid\n        AND gameid=$gameid ) p_1 ON p.userid=p_1.userid\n   JOIN\n     (SELECT userid,\n             max(cast(value AS INT)) LEVEL\n      FROM rawdatas.milestone\n      WHERE snid=$snid\n        AND gameid=$gameid\n        AND milestone=\'dp\'\n        AND ds<=$ds\n      GROUP BY userid) m ON p.userid = m.userid\n   WHERE p_1.userid IS NULL\n   GROUP BY ds,\n            LEVEL,\n            SOURCE) t_7 ON t_3.ds=t_7.ds\nAND t_3.LEVEL=t_7.LEVEL\nAND t_3.SOURCE = t_7.source');
INSERT INTO `engine_etls` VALUES (15, 'daily', 1, '清洗(pc)', 'test', '2019-11-18 21:26:22', '2019-11-18 21:26:25', 0, 0, 'parpare', 'INSERT OVERWRITE TABLE etl_dailyreport.cleaned_dau PARTITION (snid=$snid,gameid=$gameid,ds=\'$ds\')\nSELECT /*+ MAPJOIN(t_1) */ t_1.userid userid,\n       if(ip = \'\'\n          OR ip IS NULL,\'unknown\',ip) ip,\n       if(roleid=\'\'\n          OR roleid IS NULL,\'unknown\',roleid) roleid,\n       if(SOURCE = \'\'\n          OR SOURCE IS NULL,\"unknown\",SOURCE) SOURCE,\n                                              if(creative = \'\'\n                                                 OR creative IS NULL,\"unknown\",creative) creative,\n                                              if(udid = \'\'\n                                                 OR udid IS NULL,\"unknown\",udid) udid,\n                                              if(clientid = \'\'\n                                                 OR clientid IS NULL,\'unknown\',clientid) clientid\nFROM\n  (SELECT userid,\n          collect_set(ds)[0] ds, collect_set(ip)[0] ip\n   FROM dau\n   WHERE snid=$snid\n     AND gameid=$gameid\n     AND ds=\'$ds\'\n     GROUP BY userid) t_1\nJOIN\n  (SELECT * from(select userid,\n          snid,\n          gameid,\n          ds,\n          roleid,\n          SOURCE,\n          creative,\n          udid,\n          clientid,\n          row_number() OVER(PARTITION BY userid ORDER by installdate,installtime DESC) index\n   FROM install\n   WHERE snid=$snid\n     AND gameid=$gameid) t_3 \n     WHERE t_3.index=1) t_2 ON t_1.userid =t_2.userid;\n\nINSERT OVERWRITE TABLE etl_dailyreport.cleaned_payment PARTITION (snid=$snid,gameid=$gameid,ds=\'$ds\')\nSELECT /*+ MAPJOIN(t_1) */ t_1.userid userid,\n                           if(t_2.roleid=\'\'\n                              OR t_2.roleid IS NULL,\'unknown\',t_2.roleid) roleid,\n                           if(t_2.SOURCE = \'\'\n                              OR t_2.SOURCE IS NULL,\"unknown\",t_2.SOURCE) SOURCE,\n                                                                          if(t_2.creative = \'\'\n                                                                             OR t_2.creative IS NULL,\"unknown\",t_2.creative) creative,\n                                                                          if(t_2.udid = \'\'\n                                                                             OR t_2.udid IS NULL,\"unknown\",t_2.udid) udid,\n                                                                          if(t_2.clientid = \'\'\n                                                                             OR t_2.clientid IS NULL,\'unknown\',t_2.clientid) clientid,\n                                                                          if(t_1.currency= \'\'\n                                                                             OR t_1.currency IS NULL,\'unknown\',t_1.currency) currency,\n                                                                          if(t_1.amount=\'\'\n                                                                             OR t_1.amount IS NULL,\'0\',t_1.amount) amount,\n                                                                          if(t_1.value2=\'\'\n                                                                             OR t_1.value2 IS NULL,\'0\',t_1.value2) value2,\n                                                                             if(download_from IS NULL,\'unknown\', download_from) download_from,\n                                                                             if(ratio IS NULL,\'unknown\', ratio) ratio,\n                                                                          if(t_1.status =\'\'\n                                                                             OR t_1.status IS NULL,\'unknown\',t_1.status) status,\n                                                                          if(t_1.transactionid = \'\'\n                                                                             OR t_1.transactionid IS NULL,\'unknown\',t_1.transactionid) transactionid,\n                                                                          if(provider =\'\' or provider IS NULL,\'unknown\',provider) provider,\n                                                                          if(ip =\'\' or ip IS NULL,\'unknown\',ip) ip,\n                                                                          if(kingdom = \'\' or kingdom IS NULL,\'unknown\',kingdom) kingdom,\n                                                                          if(phylum = \'\' or phylum IS NULL,\'unknown\',phylum) phylum,\n                                                                          paymentdate,\n                                                                          paymenttime,\n                                                                          if(client_version =\'\' or client_version IS NULL,\'unknown\',client_version) client_version,\n                                                                          if(phone_version =\'\' or phone_version IS NULL,\'unknown\',phone_version) phone_version,\n                                                                          if(phone_type=\'\' or phone_type IS NULL,\'unknown\', phone_type) phone_type,\n                                                                          if(service =\'\' or service IS NULL,\'unknown\', service) service\n                                                                          \n                                                                          \nFROM\n  (SELECT *\n   FROM\n     (SELECT *,\n             row_number() OVER(PARTITION BY userid,paymenttime,paymentdate ) indexs\n      FROM rawdatas.payment\n      WHERE snid=$snid\n        AND gameid=$gameid\n        AND ds=\'$ds\'\n        AND status!=\'fail\' ) clean_pay\n   WHERE indexs=1) t_1\nJOIN\n  (SELECT *\n   FROM\n     (SELECT *,\n             row_number() OVER(PARTITION BY userid\n                               ORDER BY installdate,installtime DESC) indexs\n      FROM rawdatas.install LATERAL VIEW json_tuple(extra,\'client_version\',\'phone_version\',\'phone_type\',\'service\',\'download_from\',\'ratio\') json_extra AS client_version,\n                                         phone_version,\n                                         phone_type,\n                                         service,\n                                         download_from,\n                                         ratio\n      WHERE snid=$snid\n        AND gameid=$gameid\n        AND ds<=\'$ds\' ) clean_install\n   WHERE indexs=1) t_2 ON t_1.userid =t_2.userid;\n   \n   INSERT OVERWRITE table etl_dailyreport.cleaned_online_duration PARTITION(snid=$snid,gameid=$gameid,ds=\'$ds\')\nSELECT \n          CASE\n              WHEN if(total_time >= \'0\' AND total_time < \'60\',\'60\',total_time)=\'60\' THEN \'0-1分钟\'\n              WHEN if(total_time>=\'60\'\n                      AND total_time<\'300\',\'300\',total_time)=\'300\' THEN \'1-5分钟\'\n              WHEN if(total_time>=\'300\'\n                      AND total_time<\'600\',\'600\',total_time)=\'600\' THEN \'5-10分钟\'\n              WHEN if(total_time>=\'600\'\n                      AND total_time<\'1200\',\'1200\',total_time)=\'1200\' THEN \'10-20分钟\'\n              WHEN if(total_time>=\'1200\'\n                      AND total_time<\'1800\',\'1800\',total_time)=\'1800\' THEN \'20-30分钟\'\n               ELSE \'大于30分钟\'\n          END AS TYPE,userid\n   FROM\n     (SELECT ds,\n             userid,\n             sum(t_3.time) total_time\n      FROM\n        (SELECT ds,\n                userid,kingdom, (unix_timestamp(max_time)-unix_timestamp(min_time)) TIME\n         FROM\n           (SELECT ds,\n                   userid,\n                   kingdom,\n                   max(concat(counterdate,\' \',countertime)) max_time,\n                   min(concat(counterdate,\' \',countertime)) min_time\n            FROM rawdatas.counter\n            WHERE counter=\'heartBeat\'\n              AND snid=$snid\n              AND gameid=$gameid\n              AND ds=\'$ds\'\n            GROUP BY userid,\n                     kingdom,\n                     ds) t_1\n         GROUP BY userid,\n                  kingdom,\n                  max_time,\n                  min_time,\n                  ds) t_3\n      GROUP BY userid,\n               ds) t_4');
INSERT INTO `engine_etls` VALUES (16, 'daily', 3, '访问趋势', 'test', '2019-11-21 16:36:02', '2019-11-21 16:36:06', 0, 0, 'visits', 'INSERT OVERWRITE TABLE etl_dailyreport.visit_trending PARTITION(snid=$snid,gameid=$gameid,ds=\'$ds\')\nSELECT t_1.visits,\n       (t_1.visits/t_3.dau_num) average_visits,\n       (t_2.stay_time/t_3.dau_num) average_stay_visits\nFROM\n  (SELECT ds,\n          count(1) visits\n   FROM rawdatas.counter\n   WHERE snid=$snid\n     AND gameid=$gameid\n     AND ds=\'$ds\'\n     AND counter=\'loading\'\n     AND phylum=\'1\'\n   GROUP BY ds) t_1\nJOIN\n  (SELECT ds,\n          sum(unix_timestamp(max_time)-unix_timestamp(min_time)) stay_time\n   FROM\n     (SELECT ds,\n             userid,\n             kingdom,\n             max(concat(counterdate,\' \',countertime)) max_time,\n             min(concat(counterdate,\' \',countertime)) min_time\n      FROM rawdatas.counter\n      WHERE counter=\'heartBeat\'\n        AND snid=$snid\n        AND gameid=$gameid\n        AND ds=\'$ds\'\n      GROUP BY userid,\n               kingdom,\n               ds) t_1\n   GROUP BY ds) t_2 ON t_1.ds=t_2.ds\nJOIN\n  (SELECT *\n   FROM etl_dailyreport.daily_stats\n   WHERE snid=$snid\n     AND gameid=$gameid\n     AND ds=\'$ds\') t_3 ON t_1.ds=t_3.ds');
INSERT INTO `engine_etls` VALUES (17, 'daily', 2, '设备分布', 'test', '2019-11-26 20:49:48', '2019-11-26 20:49:52', 0, 0, 'device_distributions', 'INSERT OVERWRITE TABLE etl_dailyreport.device_distributions PARTITION(snid=$snid,gameid=$gameid,ds=\'$ds\')\nSELECT \n       t_1.phone_type device,\n       install_device_num,\n       dau_device_num\nFROM\n  (SELECT ds,\n          count(DISTINCT userid) dau_device_num,\n          get_json_object(extra,\'$.phone_type\') phone_type\n   FROM rawdatas.dau\n   WHERE snid=$snid\n     AND gameid=$gameid\n     AND ds=\'$ds\'\n   GROUP BY get_json_object(extra,\'$.phone_type\'),\n            ds) t_1\nLEFT JOIN\n  (SELECT ds,\n          count(DISTINCT userid) install_device_num,\n          get_json_object(extra,\'$.phone_type\') phone_type\n   FROM rawdatas.install\n   WHERE snid=$snid\n     AND gameid=$gameid\n     AND ds=\'$ds\'\n   GROUP BY get_json_object(extra,\'$.phone_type\'),\n            ds)t_2 ON t_1.ds= t_2.ds\nAND t_1.phone_type=t_2.phone_type');
INSERT INTO `engine_etls` VALUES (18, 'daily', 2, '在线时长分布', 'test', '2019-11-28 15:36:31', '2019-11-28 15:36:35', 0, 0, 'online_duration_destributions', 'INSERT OVERWRITE TABLE etl_dailyreport.online_duration_distributions PARTITION(snid=$snid,gameid=$gameid,ds=\'$ds\')\nSELECT online_duration.duration,\n       online_duration.numbers,\n       online_duration_retention.numbers,\n       online_duration.ds\nFROM\n  (SELECT ds,\n          duration,\n          count(DISTINCT userid) numbers\n   FROM\n     (SELECT ds,\n             duration,\n             userid\n      FROM etl_dailyreport.cleaned_online_duration\n      WHERE snid=$snid\n        AND gameid=$gameid\n        AND ds=date_sub(\'$ds\',1) ) c LEFT SEMI\n   JOIN\n     (SELECT userid\n      FROM rawdatas.install\n      WHERE snid=$snid\n        AND gameid=$gameid\n        AND ds=date_sub(\'$ds\',1)) i ON c.userid = i.userid\n   GROUP BY duration,\n            ds) online_duration\nJOIN\n  (SELECT duration,\n          count(DISTINCT t_1.userid) numbers\n   FROM\n     (SELECT userid\n      FROM rawdatas.dau\n      WHERE snid=$snid\n        AND gameid=$gameid\n        AND ds=\'$ds\')t_1\n   JOIN\n     (SELECT ds,\n             userid,\n             duration\n      FROM etl_dailyreport.cleaned_online_duration\n      WHERE snid=$snid\n        AND gameid=$gameid\n        AND ds=date_sub(\'$ds\',1)) t_2 ON t_1.userid= t_2.userid\n   JOIN\n     (SELECT userid\n      FROM rawdatas.install\n      WHERE snid=$snid\n        AND gameid=$gameid\n        AND ds=date_sub(\'$ds\',1)) t_3 ON t_2.userid= t_3.userid\n   GROUP BY duration) online_duration_retention ON online_duration.duration = online_duration_retention.duration');
INSERT INTO `engine_etls` VALUES (19, 'daily', 2, '广告趋势', 'test', '2019-12-03 15:55:39', '2019-12-03 15:55:43', 0, 0, 'ad_tracking', 'INSERT OVERWRITE TABLE etl_dailyreport.ad_tracking_creative PARTITION(snid=$snid,gameid=$gameid,ds=\'$ds\')\nSELECT ifa,\n       creative,\n       count(t_1.userid),\n       count(DISTINCT t_1.userid)\nFROM\n  (SELECT ifa,\n          userid\n   FROM rawdatas.adtracking\n   WHERE ds=\'$ds\'\n     AND snid=$snid\n     AND gameid=$gameid) t_1\nJOIN\n  (SELECT userid,\n          creative\n   FROM rawdatas.install\n   WHERE ds=\'$ds\'\n     AND snid=$snid\n     AND gameid=$gameid) t_2 ON t_1.userid=t_2.userid\nGROUP BY ifa,\n         creative');
